import { objectsSliceActions } from "..";
import { normolizeEntities } from "../../helpers/normalizeEntites";

export const getPackagePrices = ({userId}) => (dispatch) => {

  const options = {
    method: "POST",
    headers: {
      "Content-Type": "application/json;charset=utf-8",
    },
    body: JSON.stringify({
        userId
    }),
  };

  const url = new URL("http://localhost:4000/getObjectsPrices");

  fetch(url, options)
    .then((res) => res.json())
    .then((data) => {
      console.log(data)
    })
    .catch((err) => {
      console.log(err)
    });
};
